import React from "react";

function Register() {
    return (
    <>
        <section className="py-10 bg-gradient-to-r from-cyan-500 to-blue-500 h-screen">
            <div className="container mx-auto">
                 <h1 className="text-2xl">Register</h1>
            </div>
        </section>
    </>
    );
  }
  
  export default Register;
